import 'antd/dist/antd.css';
import {  Button, Select } from 'antd';
import { Link } from 'react-router-dom';

const { Option } = Select;
function Buttons(props) {
  return (
    <>
      <Link to="/NewJob">
        <Button
          type="primary"
          style={{
            marginBottom: 16,
            background: `#509EFC 0% 0% no-repeat padding-box`,
            borderRadius: `6px`,
            opacity: `1`,
            float: `right`,
            marginTop: `107px`,
            marginRight: `10%`,
          }}
        >
          CREATE NEW
        </Button>
      </Link>
    </>
  );
}

export default Buttons;
